import './App.css';
import { Container, Row, Col, Form, FormGroup, Label, Input, Button, Card } from "reactstrap";
import { Link, useNavigate, BrowserRouter as Router, Route } from "react-router-dom";

function App() {

  const navigate = useNavigate();

  function btnclk() {
    navigate("/Lab");
  }
  return (
//     <Router>
//       <Routes>
//       <Route path="/" element={<Lab />} />
//       </Routes>
// </Router>
    <div className='bor bg-dark'>
      <Container >
        <Row>
          <Col className='borr'>
            left
          </Col>

          <Col className='borl'>
            right
          </Col>
        </Row>
      </Container>

      <div>
        <Card style={{
          width: '18rem'
        }} className="loc rounded-circle border-info bg-dark">
          <img src="https://cdn-icons-png.flaticon.com/512/25/25968.png" width="90px" className='btnn'></img>

          <Form onSubmit={btnclk()}>
            <FormGroup>
              <Label
                for="examplePassword"
                className='card text-center'
              >
                ENTER YOUR LEARNING PASSWORD
              </Label>
              <Input
                id="examplePassword"
                name="password"
                placeholder="Password"
                type="password"
                className='text-center'
              />
            </FormGroup>
            <Button type='submit' className='btnn btn-lg text-dark bg-info'>
              Enter Lab
            </Button>
          </Form>

        </Card>
        </div>

        <Container>
          <Row>
            <Col className='borr'>
              left
            </Col>

            <Col className='borl'>
              right
            </Col>
          </Row>
        </Container>

      </div>



  );
}

export default App;
